import React, {Component} from 'react';
import { Navbar, NavbarBrand, NavItem, NavLink, Nav, Col, Row, Container, Input } from 'reactstrap';
import Linkify from 'react-linkify';

export default class MainPage extends Component {
  render() {
    return (
        <div>
            <Navbar color="light" light expand="md">
                <NavbarBrand style={{marginLeft: '10px'}} class="logo" href="#">CV Management</NavbarBrand>
                <Nav className="ml-auto" navbar>
                    <NavItem>
                        <NavLink href="#">Profile</NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink href="#">Logout</NavLink>
                    </NavItem>
                </Nav>
            </Navbar>

            <center>
                <h1 style={{marginTop: '40px'}}>Search for name</h1>
                <Input class="loginForm" autoFocus type="text" name="email" id="exampleEmail" placeholder="Search" />
            </center>

            <Container style={{backgroundColor: 'white', height: '600px', marginTop: '50px'}}>
            </Container>
        </div>
    );
  }
}
